    true,nt"url": null,nt"notes": "The National Household Education Survey,
    2005 Early Childhood Program Participation (ECPP-NHES:2005), is a study that is
    part of the National Household Education Survey (NHES) program. ECPP-NHES:2005 (http://nces.ed.gov/nhes/)
    is a cross-sectional survey that collects data directly from households on educational
    issues. This study was conducted using address based sample, self-administered questionnaires
    of households. Households in 2005 were sampled. The studyufffds response rate was
    67.5 percent. Key statistics produced from ECPP-NHES:2005 are participation in early
    childhood education and care programs.",nt"license_title": "Creative Commons
